import { useState} from "react";
import Form from 'react-bootstrap/Form';
import data from "../data.js";


function Main (){

    return(
    <div>
    <h1>심리테스트</h1>
    <br/>
    {
    data.map(function(test){
        return(
            <div style={{whiteSpace : 'pre-wrap'}}> 
            <h4 style={{fontWeight : "600"}}>{test.text}</h4>
            <br/>
            <h4 >
            <Form>
      {[ 'radio'].map((type) => (
        <div key={`inline-${type}`} className="mb-3">
          <td><Form.Check
            inline
            name="myRadioGroup"
            type={type}
            id={`inline-${type}-1`}
          />아니다</td>
          <Form.Check
            inline
            label="그저그렇다"
            name="myRadioGroup"
            type={type}
            id={`inline-${type}-2`}
          />
          <Form.Check
            inline
            label="그렇다"
            type={type}
            name="myRadioGroup"
            id={`inline-${type}-3`}
          />
            <Form.Check
            inline
            label="매우그렇다"
            type={type}
            name="myRadioGroup"
            id={`inline-${type}-4`}
          />
        </div>
      ))}
    </Form>
          </h4>
          <br/>
          </div>
        )
        
    })}
      
    </div>
    )
}

